Amazon Simple Storage Service
Amazon S3 提供的访问策略选项大致可分为基于资源的策略和用户策略两类。附加到资源 (存储桶和对象) 的访问策略称为基于资源的策略。例如，存储桶策略和访问控制列表 (ACL) 就是基于资源的策略。您也可以将访问策略附加到您账户中的用户。这些策略称为用户策略。您可以选择使用基于资源的策略、用户策略或这些策略的某种组合来管理您的 Amazon S3 资源权限。
应用示例

创建 Policy，命名为 AppInEC2AccessS3
{
 "Version": "2012-10-17",
 "Statement": [
     {
         "Sid": "VisualEditor0",
         "Effect": "Allow",
         "Action": "s3:*",
         "Resource": "*"
     }
 ]
}

将 Policy 附加到 EC2 关联的 IAM Role 上

创建存储桶

Name and region

选择启用 Server access logging (服务器访问日志记录)，将详细地记录下该存储桶收到的各种请求。
Target bucket设置为当前bucket，Target prefix设置为logs/。

编写应用程序代码
require 'vendor/autoload.php';
use Aws\S3\S3Client;
use Aws\S3\Exception\S3Exception;

 $bucket = 'test-20191209';

 $s3 = new S3Client([
     'version' => 'latest',
     'region' => 'us-east-1'
 ]);

 // Retrieve the list of buckets.
 $result = $s3->listBuckets();

 try {
     // Retrieve a paginator for listing objects.
     $objects = $s3->getPaginator('ListObjects', [
         'Bucket' => $bucket
     ]);
     echo "Keys retrieved!" . PHP_EOL;

     // Print the list of objects to the page.
     foreach ($objects as $object) {
         echo $object['Key'] . PHP_EOL;
     }

     // Upload the first object.
     $keyname = 'helloworld.md';
     $result = $s3->putObject([
         'Bucket' => $bucket,
         'Key'    => $keyname,
         'Body'   => 'Hello, world!',
     ]);
     echo $result['ObjectURL'] . PHP_EOL;

     // Upload the second object.
     $keyname = 'welcome.jpg';
     $result = $s3->putObject([
         'Bucket' => $bucket,
         'Key'    => $keyname,
         'SourceFile'   => 'images/welcome-bg.jpg',
         'ContentType' => 'image/jpeg',
     ]);
     echo $result['ObjectURL'] . PHP_EOL;

     // Delete an object.
     $result = $s3->deleteObject([
         'Bucket' => $bucket, // REQUIRED
         'Key' => $keyname, // REQUIRED
     ]);
 } catch (S3Exception $e) {
     echo $e->getMessage() . PHP_EOL;
 }


